CREATE DEFINER=`root`@`localhost` PROCEDURE `summarizeAimTest`(IN param_testid INT)
BEGIN

  DECLARE n, bins INT;

  DECLARE binStart, binWidth, mean, sd, min, q1, median, q3, max FLOAT;



  SELECT count(*) OVER (),

    avg(time) OVER (),

    stddev_samp(time) OVER (),

    min(time) OVER (),

    percentile_cont(0.25) WITHIN GROUP (ORDER BY time) OVER (),

    percentile_cont(0.5) WITHIN GROUP (ORDER BY time) OVER (),

    percentile_cont(0.75) WITHIN GROUP (ORDER BY time) OVER (),

    max(time) OVER ()

  INTO n, mean, sd, min, q1, median, q3, max

  FROM aim_test

  LIMIT 1;



  CREATE OR REPLACE TEMPORARY TABLE summary

    (

      stat VARCHAR(5),

      n INT,

      mean FLOAT,

      sd FLOAT,

      min FLOAT,

      q1 FLOAT,

      median FLOAT,

      q3 FLOAT,

      max FLOAT,

      bins INT,

      binStart FLOAT,

      binWidth FLOAT

    );



  SET

    binStart = 0.0,

    binWidth = round(2 * (q3 - q1) * pow(n, -1.0 / 3.0), 2), -- Freedman Diaconis rule

    bins = ceil((max - binStart) / binWidth);



  SELECT floor((time - binStart) / binWidth) AS bin, -- time histogram

    count(*) / n AS freq

  FROM aim_test

  GROUP BY bin;



  INSERT INTO

    summary (stat, n, mean, sd, min, q1, median, q3, max, bins, binStart, binWidth)

    VALUE ('time', n, mean, sd, min, q1, median, q3, max, bins, binStart, binWidth);



  SELECT avg(rel_error),

    stddev_samp(rel_error),

    min(rel_error),

    max(rel_error)

  INTO mean, sd, min, max

  FROM aim_test;



  SET

    binStart = 0.0,

    binWidth = 0.05, -- fixed 20 bins

    bins = ceil((max - binStart) / binWidth);





  SELECT floor((rel_error - binStart) / binWidth) AS bin, -- relative error histogram

    count(*) / n AS freq

  FROM aim_test

  GROUP BY bin;



  INSERT INTO

    summary (stat, n, mean, sd, min, max, bins, binStart, binWidth)

    VALUE ('error', n, mean, sd, min, max, bins, binStart, binWidth);



  SELECT * FROM summary; -- summary statistics



  IF ISNULL(param_testid) THEN -- query

    SELECT NULL WHERE NULL;

  ELSE

    SELECT round,

      tX,

      tY,

      cX,

      cY,

      time,

      target_distance as targetDist,

      rel_error as relError

    FROM aim_test

    WHERE testid = param_testid;

  END IF;

END ;;
DELIMITER ;
